INSERT INTO `article` (`article_id`, `article_name`, `article_alias`, `article_key`, `article_category_id`, `article_image`, `image_size_id`, `article_description`, `article_sort_order`, `article_status`, `article_category_tags`, `article_related_keywords`, `custom_page_title`, `meta_keyword`, `meta_description`, `robots`, `author`, `content_rights`, `article_created_date`, `article_modified_date`) VALUES
(1, 'INVITE_FRIEND_MAIL', 'invite_friend_mail', 'INVITE_FRIEND_MAIL', 0, 'assets/article/invite51489310_m.jpg', 0, 'I Invite you to buy Fresh Vegetables in Gujcart.com<br />\nYou can even invite your friends, for every friend that register and purchase first time you will get discount of Rs. 10.<br />\n&nbsp;', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:15:41', '2016-01-23 08:15:54'),
(3, 'THANK YOU', 'thank-you', 'THANK_YOU', 0, 'assets/article/thank1706629056_m.jpg', 0, '<span style=\"color: rgb(34, 34, 34); font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 16px; font-style: italic; line-height: 25px; background-color: rgb(236, 236, 236);\">Thank you for subscribing with us. We will be more then happy to send you latest product offers and updates. Happy Shopping.</span>\n<p style=\"color: rgb(34, 34, 34); font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 16px; font-style: italic; line-height: 25px; background-color: rgb(236, 236, 236);\">It\'s nice of you to take the time to get to know us better. Here are something about us that we thought you might like to know.</p>', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:26:57', '2016-03-10 06:54:26'),
(5, 'RETURN POLICY', 'return-policy', 'RETURN_POLICY', 0, 'assets/article/Return-Icon340938644_m.png', 0, '<p class=\"static-content-header\" style=\"margin-top: 1em; margin-bottom: 1em; font-size: 16px; font-weight: bold; color: rgb(0, 0, 0); font-family: open_sansregular; text-align: justify;\">1. Cancellation policy</p>\n\n<p class=\"static-content\" style=\"margin-top: 1em; margin-bottom: 1em; font-size: 16px; color: rgb(0, 0, 0); font-family: open_sansregular; text-align: justify;\">Customer can call customer service number and cancel order prior to confirmation, once order is confirmed and processed it can\'t be cancelled. However, if there are changes in the delivery time you mentioned earlier in your order or need to add more products, you need to call us.</p>\n\n<p class=\"static-content-header\" style=\"margin-top: 1em; margin-bottom: 1em; font-size: 16px; font-weight: bold; color: rgb(0, 0, 0); font-family: open_sansregular; text-align: justify;\">2. Return policy</p>\n\n<p class=\"static-content\" style=\"margin-top: 1em; margin-bottom: 1em; font-size: 16px; color: rgb(0, 0, 0); font-family: open_sansregular; text-align: justify;\">We have a \"no questions asked return and refund policy\" which entitles all our customers to return the product at the time of delivery if due to some reason they are not satisfied with the quality or freshness of the product. We will take the returned product back with us and make the necessary adjustments to your order value.</p>', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:29:06', '2016-03-10 06:53:33'),
(6, 'RETURN & EXCHANGES', 'return-exchanges', 'RETURN_EXCHANGES', 0, 'assets/article/EXCHANGES881106561_m.jpg', 0, 'RETURN &amp; EXCHANGES', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:30:22', '2015-05-13 07:22:17'),
