: 20.7999992370605px;\">Any information provided by you on Gujcart.com shall not be misleading in any way.</span><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<strong style=\"line-height: 20.7999992370605px;\">6. Unauthorized or fraudulent use</strong><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<span style=\"line-height: 20.7999992370605px;\">Gujcart.com does not offer Service to children below 18 years. By registering for the Service, you warrant that you are at least 18 years old. If you are under 18, you may use Service only with the involvement of a parent or guardian. From time to time, Gujcart.com may extend promotional offers to existing or potential new customers. You agree to abide by the terms and conditions of any such offer and acknowledge that circumvention of the terms and conditions of such offers constitutes a fraudulent use. You will be liable for damages caused by such fraudulent use.</span><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<strong style=\"line-height: 20.7999992370605px;\">7. Changes in agreement</strong><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<span style=\"line-height: 20.7999992370605px;\">Gujcart.com may at any time change any of the terms of this Agreement but not limited to, the amount of, or basis for determining, any fees or charges for the Gujcart Service. If Gujcart.com makes material changes to this Agreement, Gujcart.com will provide notice to you in a manner provided in this Agreement. Your use of the Gujcart Service after any such change will be conclusively deemed acceptance of such change. Gujcart.com may discontinue or revise any or all aspects of the Gujcart Service without prior notice to you. Price and availability of products are also subject to change without prior notice. We reserve the right to correct online pricing errors. In such event, we reserve the right to correct the pricing error or cancel undelivered orders for such incorrectly priced products. You will be contacted in such circumstances. If any change is unacceptable to you, you may cancel your service and terminate this agreement by calling customer service no or sending mail at care@Gujcart.com.</span><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<strong style=\"line-height: 20.7999992370605px;\">8. Disclaimer of warranty and limitation of liability</strong><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<span style=\"line-height: 20.7999992370605px;\">Your use of the Gujcart service, Gujcart.com and the internet is entirely at your own risk. The Gujcart service, Gujcart.com and its contents are provided on an \"as is\", \"as available\" basis. To the fullest extent permitted by law, Gujcart.com disclaims all representations and warranties, including, but not limited to, warranties as to the availability, accuracy or content of information, products or services, and warranties of title, non-infringement, merchantability or fitness for a particular purpose. Gujcart.com does not warrant that the functions provided by Gujcart.com will be uninterrupted or error-free, or that Gujcart.com or the server that makes it available are free from viruses or other harmful components.</span><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<span style=\"line-height: 20.7999992370605px;\">Neither Gujcart.com nor any of its directors, partners, employees, agents, licensors or merchants (collectively, its \"associates\") shall be liable for damages of any kind, including, but not limited to, direct, indirect, incidental, punitive and consequential damages, arising from your use of, or inability to use, the Gujcart service, Gujcart.com, the internet or for any other claims related in any way to your relationship with Gujcart.com.</span><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<strong style=\"line-height: 20.7999992370605px;\">9. Indemnification</strong><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<span style=\"line-height: 20.7999992370605px;\">You agree to defend, indemnify and hold Gujcart.com and its Associates harmless from any claims and expenses, including attorney\'s fees, arising in connection with a violation of this Agreement by you or through use of your account.</span><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<strong style=\"line-height: 20.7999992370605px;\">10. Termination</strong><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<span style=\"line-height: 20.7999992370605px;\">Gujcart.com may suspend or terminate your access to the Gujcart Service at any time for any reason with or without notice to you. You may terminate your Gujcart Service at any time for any reason by delivering notice in a manner provided in this Agreement which termination will be effective the day notice is received or such later date specified in the notice.</span><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<strong style=\"line-height: 20.7999992370605px;\">11. Privacy and security</strong><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<span style=\"line-height: 20.7999992370605px;\">Your privacy is very important to Gujcart.com. Please see the privacy policy page for more details and review a complete statement of our Privacy and Security Policy which also governs your use of Gujcart.com and the Gujcart Service.</span><br style=\"line-height: 20.7999992370605px;\" />\n<br style