se Terms of Service constitute the entire agreement between the parties with respect to the subject matter hereof and supersedes and replaces all prior or contemporaneous understandings or agreements, written or oral, regarding such subject matter. The clauses as above shall survive the termination or expiry of this agreement. This electronic record is generated by a computer system and does not require any physical or digital signatures.</span><br style=\"line-height: 20.7999992370605px;\" />\n<br style=\"line-height: 20.7999992370605px;\" />\n<u style=\"line-height: 20.7999992370605px;\">Arbitration</u><span style=\"line-height: 20.7999992370605px;\">: If any dispute arises between you and Gujcart.com during your use of the Website or thereafter, in connection with the validity, interpretation, implementation or alleged breach of any provision of the User Agreement and Terms and Conditions the dispute shall be first referred to a sole Arbitrator who shall be an independent and neutral third party identified by Gujcart.com. The place of arbitration shall be Surat. The Arbitration &amp; Conciliation Act, 1996, shall govern the arbitration proceedings. The arbitration proceedings shall be in the English language.</span><br style=\"line-height: 20.7999992370605px;\" />\n<u style=\"line-height: 20.7999992370605px;\">Applicable law</u><span style=\"line-height: 20.7999992370605px;\">: This site is created and controlled by Gujcart.com. Gujcart.com have given the permission to </span>hsquaretech.com<span style=\"line-height: 20.7999992370605px;\"> for maintaining this website. </span>hsquaretech.com<span style=\"line-height: 20.7999992370605px;\">&nbsp;have full rights to modification on this site on behalf of Gujcart.com. The laws of India shall apply and courts in Surat shall have jurisdiction in respect of all the Terms &amp; Conditions, Privacy Policy and disclaimers. Gujcart.com reserves the right to make changes to the website, Terms &amp; Conditions, Privacy Policy and disclaimers at any time and without information to the customers/users of the services/website of Gujcart.com. Users are advised to regularly check for any amendments or updates to the terms and conditions contained herein.</span>', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:30:44', '2016-08-30 05:45:03'),
(8, 'PRIVACY POLICY', 'privacy-policy', 'PRIVACY_POLICY', 0, 'assets/article/PRIVACY_POLICY2136459769_m.jpg', 0, '<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">This privacy policy sets out how Gujcart.com uses and protects any information that you give Gujcart.com when you use this website. Gujcart.com is committed to ensuring that your privacy is protected. Should we ask you to provide certain information by which you can be identified when using this website, then you can be assured that it will only be used in accordance with this privacy statement. Gujcart.com may change this policy at any time without giving notice by updating this page. You should check this page from time to time to ensure that you are happy with any changes. By shopping at Gujcart.com, you are accepting the practices described in this Privacy Policy.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<strong style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">1. What Personal Information is collected and how?</strong><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">When you register/place order with Gujcart.com, you provide us with your name, billing and delivery addresses, e-mail, contact number, etc. You select a username and password allowing you access to the Gujcart Service. Your password should be kept strictly confidential to prevent unauthorized use. While using the Gujcart Service, you may give us special shopping and delivery instructions, which we store and use to pick and deliver your order to your specifications We do use your contact information to send you offers based on your previous orders and your interests.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<strong style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">2. What Cookies are collected?</strong><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">Gujcart also receives and stores certain types of information whenever you interact with us through the use of \"cookies.\" Cookies enable our systems to recognize your browser and to provide you with certain shopping features. These \"cookies\" allow us to give you customized and personalized service and helps us identify ways to improve your shopping experience. The \"help\" portion of the toolbar on most browsers will tell you how to reject or disable cookies or receive notice when a new cookie appears. If you choose to reject or disable cookies, you will not be able to use those Gujcart Services that require the use of such cookies. Gujcart.com\'s cookies do not contain any of your personally identifiable information.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">Additionally, you may encounter \"cookies\" or other similar devices on certain pages of the Website that are placed by third parties. We do not control the use of cookies by third parties.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">If you choose to buy on the Website, we collect information about your buying behavior.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">If you choose to post messages on our message boards, chat rooms or other message areas or leave feedback, we will collect that information you provide to us. We retain this information as necessary to resolve disputes, provide customer support and troubleshoot problems as permitted by law.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">If you send us personal correspondence, such as emails or letters, or if other users or third parties send us correspondence about your activities or postings on the Website, we may collect such information into a file specific to you.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">We collect personally identifiable information (email address, name, phone number etc.) from you when you set up a free account with us. We do use your contact information to send you offers based on your previous orders and your interests.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<strong style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">3. How does Gujcart use your information?</strong><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">Gujcart uses your information to provide the Gujcart Service and to enhance and personalize your shopping experience. Gujcart does not sell personal information about individual customers (such as name, address, e-mail address) to third parties, sell or rent lists of customers or use information about individual customers except to provide the Gujcart Service or as described below.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">Gujcart may use aggregated information regarding its customers and usage of the Gujcart Service (such as customer demographics and traffic patterns) and disclose such aggregated information to advertisers, partners and others for various purposes.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">Gujcart may employ other companies and individuals to perform certain functions such as delivering packages and analyzing data. They may have access to personal information to perform their functions. Gujcart may transfer Customer Registration Data and other personal information in connection with the sale of Gujcart or the sale or transfer of its business operations in your geographic area to a third party provider of grocery ordering or delivery services who agrees to be bound by this Privacy Policy until you consent that such information will be governed by the policies and terms of such third party provider. Gujcart may use or disclose personal information when Gujcart believes it is appropriate to enforce this Agreement, to protect the rights, property or safety of Gujcart or its users or to comply with the law.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<strong style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">4. What is Gujcart privacy with Links to Other Sites?</strong><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">Our website may contain links to other websites of interest. However, once you have used these links to leave our site, you should note that we do not have any control over that other website. Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst visiting such sites and such sites are not governed by this privacy statement. You should exercise caution and look at the privacy statement applicable to the website in question.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<strong style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">5. What are the Security Precautions?</strong><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">Our site has stringent security measures in place to protect the loss, misuse, and alteration of the information under our control. Whenever you change or access your account information, we offer the use of a secure server. Once your information is in our possession we adhere to strict security guidelines, protecting it against unauthorized access.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<strong style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">6. How may you change or remove your personal information?</strong><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">You may at any time review and change your personal information stored by Gujcart.com by accessing the My Account page at Gujcart.com or by contacting Gujcart Customer Care.You may also request that Gujcart permanently remove all personal information stored by Gujcart at any time by delivering notice requesting such removal in the manner provided in the Gujcart Customer Agreement. Upon such request, Gujcart will remove all such information and will not thereafter use personally identifiable information about you in any way. Such request will automatically terminate your Gujcart Service.</span>', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:31:01', '2015-05-13 07:22:48'),
