(10, 'ABOUT US', 'about-us', 'ABOUT_US', 0, 'assets/article/Kriti_black1133350058_m.jpg', 0, 'We Gujcart are presenting an alluring range of Bollywood Replica Suits &amp; Sarees with our esteemed clients. Bollywood can be credited with putting the Indian saree on the global map. Modern day sarees are made in numerous styles and for numerous occasions. Bollywood has, time and again, featured a great collection of sarees in all of its aspects, be it on screen or on the red carpet itself. Indian women increasingly now wear sarees for formal occasions, board room meetings and even red carpet appearances. It is no doubt then that the saree, in modern times, has become a must-have for every woman, Indian or otherwise. The offered suits &amp; sarees are crafted with premium quality chiffon, cotton, georgette, net and silk that ensure comfort and smooth texture. Furthermore, these suits &amp; sarees are carefully designed exactly same as the original. These are embellished with vivid stone, jari, zardozi and golden thread work which adds grace to the personality of the wearer. For More Details Address Surat, Gujarat, India', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:32:49', '2016-02-24 16:53:41'),
(11, 'SHIPPING INFORMATION', 'shipping-information', 'SHIPPING_INFORMATION', 0, 'assets/article/New1595710600_m.png', 0, '<table class=\"list\">\r\n	<tbody class=\"ajaxdata\">\r\n		<tr id=\"18\">\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n			<td class=\"left\">SHIPPING INFORMATION</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:34:05', '0000-00-00 00:00:00'),
(12, 'GUJCART COUPON', 'gujcart-coupon', 'DRO', 27, 'assets/article/Kedar_parrot558557185_m.jpg', 0, '<p><span style=\"font-size:20px;\"><span style=\"font-family: times new roman,times,serif;\"><span style=\"color: rgb(0, 0, 0);\"><strong><span style=\"font-size:22px;\">Now Gujcart offer<br />\n<br />\nGujcart give Flat give Rs.300 off on all sareese product.<br />\n<br />\nStill 31 December 16 use code \" GUJ300 \"</span></strong></span></span></span><br />\n&nbsp;</p>', 5, 0, '', '', 'Gujcart coupon', 'Gujcart promo code | Gujcart voucher | Gujcart Coupon code | Gujcart sarees coupon', 'Gujcart coupon | Gujcart Promo code', 1, 'gujcart.com', 'gujcart.com', '2016-02-24 16:40:33', '2016-12-17 13:08:43');
