(1, 8, 1, 'INVITE_FRIEND_MAIL', 'invite_friend_mail', 'INVITE_FRIEND_MAIL', 0, 'assets/article/invite51489310_m.jpg', 0, 'I Invite to buy Fresh Vegitables in Gujcart.com<br />\n<span style=\"font-size: 16px; line-height: 1.6em;\">For every friend that register and purchase first time you will get discount of Rs. 100.</span><br />\n&nbsp;', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:15:41', '0000-00-00 00:00:00'),
(2, 9, 1, 'INVITE_FRIEND_MAIL', 'invite_friend_mail', 'INVITE_FRIEND_MAIL', 0, 'assets/article/invite51489310_m.jpg', 0, 'I Invite to buy Fresh Vegitables in Gujcart.com<br />\n<span style=\"font-size: 16px; line-height: 1.6em;\">For every friend that register and purchase first time you will get discount of Rs. 100.</span><br />\n&nbsp;', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:15:42', '0000-00-00 00:00:00'),
(4, 8, 3, 'THANK_YOU', 'thank_you', 'THANK_YOU', 0, 'assets/article/101423400068_m.png', 0, '<span style=\"color: rgb(34, 34, 34); font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 16px; font-style: italic; line-height: 25px; background-color: rgb(236, 236, 236);\">Thank you for subscribing with us. We will be more then happy to send you latest product offers and updates. Happy Shopping.</span>\n<p style=\"color: rgb(34, 34, 34); font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 16px; font-style: italic; line-height: 25px; background-color: rgb(236, 236, 236);\">It\'s nice of you to take the time to get to know us better. Here are something about us that we thought you might like to know.</p>', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:26:57', '0000-00-00 00:00:00'),
(5, 9, 3, 'THANK_YOU', 'thank_you', 'THANK_YOU', 0, 'assets/article/101423400068_m.png', 0, '<span style=\"color: rgb(34, 34, 34); font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 16px; font-style: italic; line-height: 25px; background-color: rgb(236, 236, 236);\">Thank you for subscribing with us. We will be more then happy to send you latest product offers and updates. Happy Shopping.</span>\n<p style=\"color: rgb(34, 34, 34); font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 16px; font-style: italic; line-height: 25px; background-color: rgb(236, 236, 236);\">It\'s nice of you to take the time to get to know us better. Here are something about us that we thought you might like to know.</p>', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:26:57', '0000-00-00 00:00:00'),
(8, 8, 5, 'RETURN_POLICY', 'return_policy', 'RETURN_POLICY', 0, 'assets/article/101494365475_m.png', 0, '<p class=\"static-content-header\" style=\"line-height: 20.7999992370605px; margin-top: 1em; margin-bottom: 1em; font-size: 16px; font-weight: bold; color: rgb(0, 0, 0); font-family: open_sansregular; text-align: justify;\">1. Cancellation policy</p>\n\n<p class=\"static-content\" style=\"line-height: 20.7999992370605px; margin-top: 1em; margin-bottom: 1em; font-size: 16px; color: rgb(0, 0, 0); font-family: open_sansregular; text-align: justify;\">Customer can call customer service number and cancel order prior to confirmation, once order is confirmed and processed it can\'t be cancelled. However, if there are changes in the delivery time you mentioned earlier in your order or need to add more products, you need to call us.</p>\n\n<p class=\"static-content-header\" style=\"line-height: 20.7999992370605px; margin-top: 1em; margin-bottom: 1em; font-size: 16px; font-weight: bold; color: rgb(0, 0, 0); font-family: open_sansregular; text-align: justify;\">2. Return policy</p>\n\n<p class=\"static-content\" style=\"line-height: 20.7999992370605px; margin-top: 1em; margin-bottom: 1em; font-size: 16px; color: rgb(0, 0, 0); font-family: open_sansregular; text-align: justify;\">We have a \"no questions asked return and refund policy\" which entitles all our customers to return the product at the time of delivery if due to some reason they are not satisfied with the quality or freshness of the product. We will take the returned product back with us and make the necessary adjustments to your order value.</p>', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:29:06', '0000-00-00 00:00:00'),
(9, 9, 5, 'RETURN_POLICY', 'return_policy', 'RETURN_POLICY', 0, 'assets/article/101494365475_m.png', 0, '<p class=\"static-content-header\" style=\"line-height: 20.7999992370605px; margin-top: 1em; margin-bottom: 1em; font-size: 16px; font-weight: bold; color: rgb(0, 0, 0); font-family: open_sansregular; text-align: justify;\">1. Cancellation policy</p>\n\n<p class=\"static-content\" style=\"line-height: 20.7999992370605px; margin-top: 1em; margin-bottom: 1em; font-size: 16px; color: rgb(0, 0, 0); font-family: open_sansregular; text-align: justify;\">Customer can call customer service number and cancel order prior to confirmation, once order is confirmed and processed it can\'t be cancelled. However, if there are changes in the delivery time you mentioned earlier in your order or need to add more products, you need to call us.</p>\n\n<p class=\"static-content-header\" style=\"line-height: 20.7999992370605px; margin-top: 1em; margin-bottom: 1em; font-size: 16px; font-weight: bold; color: rgb(0, 0, 0); font-family: open_sansregular; text-align: justify;\">2. Return policy</p>\n\n<p class=\"static-content\" style=\"line-height: 20.7999992370605px; margin-top: 1em; margin-bottom: 1em; font-size: 16px; color: rgb(0, 0, 0); font-family: open_sansregular; text-align: justify;\">We have a \"no questions asked return and refund policy\" which entitles all our customers to return the product at the time of delivery if due to some reason they are not satisfied with the quality or freshness of the product. We will take the returned product back with us and make the necessary adjustments to your order value.</p>', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:29:06', '0000-00-00 00:00:00'),
