lign: justify;\" />\n<br style=\"line-height: 20.7999992370605px; color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; text-align: justify;\" />\n<span style=\"line-height: 20.7999992370605px; color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; text-align: justify;\">Our site has stringent security measures in place to protect the loss, misuse, and alteration of the information under our control. Whenever you change or access your account information, we offer the use of a secure server. Once your information is in our possession we adhere to strict security guidelines, protecting it against unauthorized access.</span><br style=\"line-height: 20.7999992370605px; color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; text-align: justify;\" />\n<br style=\"line-height: 20.7999992370605px; color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; text-align: justify;\" />\n<strong style=\"line-height: 20.7999992370605px; color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; text-align: justify;\">6. How may you change or remove your personal information?</strong><br style=\"line-height: 20.7999992370605px; color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; text-align: justify;\" />\n<br style=\"line-height: 20.7999992370605px; color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; text-align: justify;\" />\n<span style=\"line-height: 20.7999992370605px; color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; text-align: justify;\">You may at any time review and change your personal information stored by Gujcart.com by accessing the My Account page at Gujcart.com or by contacting Gujcart Customer Care.You may also request that Gujcart permanently remove all personal information stored by Gujcart at any time by delivering notice requesting such removal in the manner provided in the Gujcart Customer Agreement. Upon such request, Gujcart will remove all such information and will not thereafter use personally identifiable information about you in any way. Such request will automatically terminate your Gujcart Service.</span>', 0, 0, '', '', '', '', '', 1, '', '', '2015-05-05 08:30:44', '0000-00-00 00:00:00');
