(14, 8, 8, 'PRIVACY POLICY', 'privacy-policy', 'PRIVACY_POLICY', 0, 'assets/article/New1085764099_m.png', 0, '<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">This privacy policy sets out how Gujcart.com uses and protects any information that you give Gujcart.com when you use this website. Gujcart.com is committed to ensuring that your privacy is protected. Should we ask you to provide certain information by which you can be identified when using this website, then you can be assured that it will only be used in accordance with this privacy statement. Gujcart.com may change this policy at any time without giving notice by updating this page. You should check this page from time to time to ensure that you are happy with any changes. By shopping at Gujcart.com, you are accepting the practices described in this Privacy Policy.</span><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<strong style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">1. What Personal Information is collected and how?</strong><br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: open_sansregular; font-size: 16px; line-height: 20.7999992370605px; text-align: justify;\">When you register/place order with Gujcart.com, you provide us with your name, billing and delivery addresses, e-mail, contact number, etc. You select a username and