(22, 8, 12, 'Dro', 'dro', 'DRO', 27, 'assets/article/Kedar_parrot1116870008_m.jpg', 0, '<span style=\"font-size:20px;\">Also see in <strong>Hindi </strong>language</span><br />\n<br />\n<strong><span style=\"font-size:22px;\">Gujcart Fashion</span></strong> <span style=\"font-size:20px;\"><strong> प्रेजेंट कर रहा हे फर्स्ट टाइम ऑनलाइन ड्रो सिस्टम इन इंडिया। ये एक ऐसी सिस्टम हे जिसमे भारत के सभी फ्रेंड्स और अन्य लोग join हो सकते हे। इस सिस्टम में 12 डिज़ाइनर फेन्सी प्रोडक्ट दी जाती हे। जिसमे से कोई भी एक प्रोडक्ट खरीद कर आप रजिस्ट्रेशन करवा सकते हे। ड्रो सिस्टम में जुड़ने के लिए ड्रो मनु में से कोई भी एक प्रोडक्ट खरीदनी पड़ेगी.<br />\n<br />\nGujcart परिवार विस्वास दिलाता हे की आपको योग्य, अच्छी और सस्ती प्रोडक्ट देंगे । हमारी प्रोडक्ट से आप निराश नहीं होंगे और आप 100 % महसूस करेंगे की आप हमारी प्रोडक्ट के बिना अबतक अधूरे थे। गुजकार्ट आपकी जरूरियात और आज की फैशन के हिसाब से आपका साथ देंगे। सिर्फ Rs. 350 से Rs. 550 तक की रकम में अच्छी + फैशनेबल + सस्ती + लकी गिफ्ट जैसी जरूरियात वाली चीजे देने वाले हे। समय व्यतीत किये बगैर रजिस्ट्रेशन कीजिये ।<br />\n<br />\nइस ड्रो सिस्टम में कुल 12 गिफ्ट देने वाले हे हर 500 व्यक्ति पर. यानी की 488 व्यक्ति को 100% उसने जो प्रोडक्ट पसंद की और खरीदी हे वो मिलेंगी और बाकि 12 लकी व्यक्ति को स्मार्ट फोन, टेबलेट, आइस-क्रीम मेकर जैसे गिफ्ट मिलेंगे । ड्रो करने की तारीख, समय और स्थल 31-Mar-16 को Gujcart वेबसाइट पर धोषणा की जाएगी।<br />\n&nbsp;<br />\n<span style=\"font-size:22px;\">जुड़ने के 10 फायदे</span><br />\n1. नो रिस्क, क्युकी आप जो प्रोडक्ट खरीदने के लिए पेमेंट करेंगे वो प्रोडक्ट 110% आपको मिलेगी ही।<br />\n2. घर बैठे कम ख़र्चे में Smart Phone जैसे गिफ्ट पाने की सम्भावना ।<br />\n3. पर 500 व्यक्ति में 12 लकी व्यक्ति&nbsp; को गिफ्ट।<br />\n4. हमारी प्रोडक्ट मार्किट रेट से कम प्राइस में मिलेगी।<br />\n5. 12 लकी व्यक्ति ओ को गिफ्ट मिलेगी।<br />\n6. चुने गए सिटी में जुड़ने से पहले प्रोडक्ट देखने को मिलेगी।<br />\n7. गिफ्ट आईटम क्रोमा, फ्लिप कार्ट, स्नेपडिल, जैसी नामांकित और जेन्युन वेबसाइट से मिलेगी। जिस से आप गिफ्ट आईटम की पूरी डिटेल्स, क्वालिटी, प्राइस, और फीचर्स देख सको।<br />\n8. Gujcart आपको विस्वास दिलाता हे की आपको अच्छी और सस्ती प्रोडक्ट देंगे जिस से आप कभी निराश नहीं होंगे।<br />\n9. हम आपको आपकी जरूरियात और फैशन के मुताबिक प्रोडक्ट देनी की कोशिश करेंगे।<br />\n10. हम आपको गिफ्ट के रूप में Rs. 350 से Rs. 550 तक की छोटी सी रकम में अच्छी, सस्ती और जरूरियात वाली चीजे देते हे।<br />\n<br />\n<span style=\"font-size:22px;\">Rules</span><br />\n1. ड्रो सिस्टम भारत के नागरिक के लिए हे। भारत के बहार के कोई लोग ड्रो में हिस्सा नहीं ले सकते हे।<br />\n2. ड्रो सिस्टम में कोई प्रोडक्ट खरीद ने के लिए किया गया पेमेंट रिफंड नहीं होगा और कोई भी कारनसर रेजिस्ट्रेशन केंसल नहीं होगा।<br />\n3. किसी भी प्रकार के वाद विवाद में आखरी फैसला गुजकार्ट एडमिन का रहेगा।<br />\n4. ड्रो सिस्टम में मिलने वाली प्रोडक्ट और गिफ्ट का कुरियर चार्ज और अन्य टैक्स खरीदनार मेंबर का रहेगा।<br />\n5. ड्रो सिस्टम में हर मेम्बर अपनी मर्जी से ज्वाइन होने के कारण कोई भी मेम्बर क़ानूनी कार्यवाही नहीं कर सकता।<br />\n6. ड्रो सिस्टम में खरीदी जाने वाली प्रोडक्ट का पेमेंट 31-Mar-16 से पहले Gujcart में जमा करना पड़ेगा। पेमेंट आप ऑनलाइ NEFT, क्रेडिट कार्ड, और डेबिट कार्ड से कर सकते हे ।<br />\n7. ड्रो सिस्टम में केश ओन डिलेवरी (COD) नहीं होगा ।<br />\n8. कुछ अनिश्वित घटना में ड्रो सिस्टम में कुछ बदल ने की आवश्यकता होगी तो एडमिन वो बदल सकते हे और इस सिस्टम में ज्वाइन हुऐ सभी मेम्बर को वो मान्य रखना पड़ेगा।<br />\n9. आपने जिस प्रोडक्ट को सिलेक्ट किया और ख़रीदा हे वही प्रोडक्ट आपको मिलेगी और कुछ फेरबदली नहीं होगी।<br />\n10. ड्रो डिक्लेर होने के बाद 10 दिन में आपकी प्रोडक्ट पार्सल की जाएगी।<br />\n11. ड्रो सिस्टम में खरीदी गई प्रोडक्ट रिटर्न नहीं कर सकते हो।<br />\n12. ड्रो सिस्टम में लकी 12 व्यक्तिओ को गिफ्ट और बाकि सभी मेम्बेर्स को सिलेक्ट की गई प्रोडक्ट मिलेगी।<br />\n13. जिसको जो गिफ्ट मिलेगा वोही लेना पड़ेगा। उसके बदले में पैसे नहीं मिलेंगे।<br />\n14. किसी भी प्रकार की माहिती पाने का समय सुबह 10 से 7 तक रहेगा।<br />\n15. जिसको गिफ्ट मिलेगा उसका नाम Gujcart.com पे डिस्प्ले किया जायेगा।<br />\n16. किसी भी मामले में न्याय क्षेत्र सूरत सिटी रहेगा।<br />\n&nbsp;<br />\n<span style=\"font-size:22px;\">FAQ</span><br />\n<span style=\"background-color:#FF8C00;\">1. ड्रो करने के पीछे आपका रीज़न क्या हे ?</span></strong></span>\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>प्रोडक्ट प्रमोशन के लिए।</strong></span></li>\n	<li><span style=\"font-size:20px;\"><strong>अच्छी और सस्ती प्रोडक्ट लोगो तक पोह्चाने के लिए। और</strong></span></li>\n	<li><span style=\"font-size:20px;\"><strong>नए नए क्लाइंट से रिलेशन बना ने के लिए।</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">2. ड्रो से होने वाले फायदे ।</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>लकी व्यकितओ को गिफ्ट मिलेगा&nbsp;और </strong></span><strong><span style=\"font-size:22px;\">बाकी लोगो को</span></strong>&nbsp;<span style=\"font-size:20px;\"><strong> प्रोडक्ट मिलेगा ।</strong></span></li>\n	<li><span style=\"font-size:20px;\"><strong>बहोत कम पैसे में अच्छी क़्वालिटी की चीजे मिलती हे।</strong></span></li>\n	<li><span style=\"font-size:20px;\"><strong>आपका हमारे साथ बना हुआ नया सबंध कायम रहे।</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">3. ड्रो में केसी केसी चीजे रखी हे ?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>ड्रो प्रोडक्ट : प्लीज क्लिक हियर अथवा कॉपी पेस्ट लिंक ओन योर browser : <a href=\"http://www.gujcart.com/draw/draw-products.html\">http://www.gujcart.com/draw/draw-products.html</a></strong></span></li>\n	<li><span style=\"font-size:20px;\"><strong>ड्रो गिफ्ट : प्लीज क्लिक हियर&nbsp; अथवा कॉपी पेस्ट लिंक ओन योर browser : <a href=\"http://www.gujcart.com/draw/draw-gift.html\">http://www.gujcart.com/draw/draw-gift.html</a></strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">4. ड्रो में कौन कौन और कितने लोग भाग ले सकते हे ?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>ड्रो में भारत के सभी भाई बंधू भाग ले सकते हे।</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">5. ड्रो की टाइम लिमिट ?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>ड्रो सिस्टम में जो लोग भाग लेना चाहते हे ड्रो मेनू में \" ड्रो प्रोडक्ट\" में जाके मन चाहा प्रोडक्ट खरीदना और पेमेंट ट्रांसफर करना यानि की रजिस्ट्रेशन तारीख 31-Mar-16 तक कर सकते हे</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">6. ड्रो में ज्वाइन होने के लिए कितने पैसे चुकाने होंगे ?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>ड्रो मेनू में &nbsp;12 प्रोडक्ट हे जो अलग अलग प्राइस की हे। आप उसमे से कोई एक पसंद कीजिये और उसका पेमेंट कीजिये बस इतना ही पैसे चुकाने हे।</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">7. क्या ड्रो में हमें प्रोडक्ट के साथ गिफ्ट भी मिलेगा ?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>ड्रा सिस्टम में जिस किसी को&nbsp; गिफ्ट मिलेगा उसको प्रोडक्ट नहीं मिलेगी। यानी की जो 12 लकी व्यक्तिओ को गिफ्ट मिलेगा पर उसके साथ प्रोड्कट नहीं मिलेगा।</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">8. ड्रो में जो चीजे हे उसकी क़्वालिटी किसी होगी ?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>हम ड्रो में और हमारी वेबसाइट में जोभी प्रोडक्ट रखी हुई हे उसमे अच्छी से अच्छी क़्वालिटी देने की कोशिश करते हे, और ड्रो की प्रोडक्ट आप खरीद ने से पहले हमारे चुने गए सिटी में देख सकते हे।</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">9. क्या आपकी सभी प्रोडक्ट के बारेमे इंफोर्मेशन मिल सकती हे ?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>हा, &nbsp;हमारी वेबसाइट के ड्रो मेनू में प्रोडक्ट के बारे मे सभी इंफोर्मेशन रखी गई हे वो आप देख सकते हो।</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">10. प्रोडक्ट खरीदने से पहले हाथ में ले के देख सकते हे ?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>हा, सूरत ऑफिस और अन्य चुने गए सिटी ऑफिस में जाके आप सभी प्रोडक्ट को लाइव देख सकते हे और क़्वालिटी भी।</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">11. क्या प्रोडक्ट पसंद ना आये तो रिटर्न कर सकते हे?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>वेबसाइट पर से खरीदी हुई चीजो के लिए रिटर्न पॉलिसी हे परन्तु ड्रो मेनू में से खरीदी हुई चीजो के लिए रिटर्न पालिसी नहीं हे।</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">12. कंपनी कहा की हे एड्रेस और कब से चल रही हे ?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>कंपनी सूरत की हे और 2014 से चल रही हे। 233, Royal Plaza, Ved Road, Katargam, Surat-395004</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">13. प्रोडक्ट एक से ज्यादा खरीद सकते हे ?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>हा, ले सकते हे।</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">14. ड्रो से आपको क्या क्या फायदे होते हे ?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>ड्रो करने से हमारी प्रोडक्ट भारत के सभी क्षेत्र में पहोच सकती हे।</strong></span></li>\n	<li><span style=\"font-size:20px;\"><strong>आपके साथ एक अच्छे सबंध बनेंगे।</strong></span></li>\n	<li><span style=\"font-size:20px;\"><strong>आप हमारे रेग्युलर ग्राहक बने वो हेतु हमारा सफल होगो।</strong></span></li>\n</ul>\n<span style=\"font-size:20px;\"><strong><span style=\"background-color:#FF8C00;\">15. क्या हम आपकी प्रोडक्ट ज्यादा लेके बेच सकते हे ?</span></strong></span>\n\n<ul>\n	<li><span style=\"font-size:20px;\"><strong>हा।</strong></span></li>\n</ul>', 5, 0, '', '', 'Dro', 'Dro', '0', 1, 'Dro', 'Dro', '2016-02-24 16:40:33', '2016-03-14 08:59:59'),
