(1, 'NEWSLETTER_SUBSCRIBER', 'Newsletter Subscriber', 'NEWSLETTER_SUBSCRIBER', 'Thank You for Subscribing at Gujcart.com', 0, '2013-08-17 00:34:48', '2015-05-05 06:03:08'),
(2, 'ACCOUNT_ACTIVATION', 'Customer : Account Activation Mail', 'Thank you for registering with GUJCART.<br /><br />Your login credentials are as follow.<br /><br />Username : {email_address}<br />Password : {text_password}<br /><br />Please&nbsp;<a href=\"{activation_link}\">Click here</a> to activate your account.<br /><br />\r\n<br />\r\n<div>Thanks &amp; regards,</div>\r\n<div>Customer Supports,</div>\r\n<div><a href=\"{base_url}\" target=\"_blank\">http://www.gujcart.com</a><br /><br /></div>\r\n<div>Feed free to add us on <a href=\"https://www.facebook.com/\" target=\"_blank\">Facebook</a> | <a href=\"https://plus.google.com/\" target=\"_blank\">Google+</a></div>', 'Your Account Has Been Created at GUJCART', 0, '2013-04-08 09:40:50', '2013-07-16 17:03:56'),
(6, 'CUSTOMER_RESEND_ACTIVATION_MAIL', 'Customer : Resend Activation Mail', 'Hello {first_name} {last_name}<br /><br />We got request from your side to resend new activation mail for your Gujcart account.&nbsp;<a href=\"{activation_link}\">Click Here</a>&nbsp;to activate your Gujcart account.<br />\r\n<div><br /><br />Thanks &amp; regards,</div>\r\n<div>Customer Support Team,</div>\r\n<div><a href=\"{base_url}\" target=\"_blank\">http://www.gujcart.com</a><br /><br /></div>\r\n<div>Feed free to add us on <a href=\"https://www.facebook.com/\" target=\"_blank\">Facebook</a> | <a href=\"https://plus.google.com/\" target=\"_blank\">Google+</a></div>', 'Activate Your Account at GUJCART', 0, '2013-04-15 15:35:30', '2013-05-29 22:48:22'),
(7, 'RESET_PASSWORD_EMAIL', 'Customer :  Forgot Password', 'Hello&nbsp;{first_name} {last_name}<br /><br />Kindly reset your password are as follow.<br /><br />Username : {email_address}<br />Password : {text_password}<br /><br />Please&nbsp;<a href=\"{login_link}\">Click here</a> to login your account.<br /><br /><br />\r\n<div>Thanks &amp; regards,</div>\r\n<div>Customer Support Team,</div>\r\n<div><a href=\"{base_url}\" target=\"_blank\">http://www.gujcart.com</a><br /><br /></div>\r\n<div>Feed free to add us on <a href=\"https://www.facebook.com/\" target=\"_blank\">Facebook</a> | \r\n<a href=\"https://plus.google.com/\" target=\"_blank\">Google+</a></div>', 'Reset Your Password at GUJCART', 0, '2013-04-15 17:10:10', '2013-05-29 22:45:59'),
(12, 'CONTACT_US_REQUEST', 'Contact Us Request', 'Hello, Admin<br /><br />&nbsp; We recieved a new contact Inquiry&nbsp;from Gujcart. please find the below details.<br /><br /><strong>Contact Detail :&nbsp;<br /></strong><br />Name : {contact_name}<br />Email : {contact_email}<br />Enquiry : {enquiry}', 'New Contact Inquiry', 1, '2013-04-19 15:13:29', '2013-05-29 22:44:50'),
(29, 'ADMIN_NOTI_CUSTOMER_ACCOUNT_CREATED', 'Admin : New customer account created', 'Hello, Admin.<br /><br />You got a new customer, please take a look at customer module at admin panel for more detail.<br /><br />Name : {first_name}<br />Phone : {phoneno}<br />Email : {user_email}<br /><br />\n<div></div>', 'Get New Customer Account GUJCART', 0, '2013-06-05 06:02:04', '0000-00-00 00:00:00'),
(30, 'GUEST_PASSWORD_EMAIL', 'Guest :   Password Email', 'Hello&nbsp;{first_name} {last_name}<br /><br />Kindly use below username and password to login into Gujcart.<br /><br />Username : {email_address}<br />Password : {text_password}<br /><br />Please&nbsp;<a href=\"{login_link}\">Click here</a> to login your account.<br /><br /><br />\r\n<div>Thanks &amp; regards,</div>\r\n<div>Customer Support Team,</div>\r\n<div><a href=\"{base_url}\" target=\"_blank\">http://www.gujcart.com</a><br /><br /></div>\r\n<div>Feed free to add us on <a href=\"https://www.facebook.com/\" target=\"_blank\">Facebook</a> | <a href=\"https://plus.google.com/\" target=\"_blank\">Google+</a></div>', 'Your Account Has Been Created at GUJCART', 0, '2013-10-23 00:18:39', '0000-00-00 00:00:00');
