(1, 1, 1, '1|2|3|112|113|114', 'BC802', 'Solo Business Cards Holder - 240Cards', 'solo-business-cards-holder-240cards', '', 7, 'assets/product/BC802/BC802759730768_m.jpg', 0, '', 'F', 'RIN', 0, 0, 0, 0, '0', 0, NULL, '0', '0', '', '', '', '<span open=\"\" style=\"color: rgb(119, 119, 119); font-family: \">(a) Excellent quality with elite styling. (b) 240 card pockets. (c) Embossed, ultrasonic welted pocket with antistatic agent for zero sticking of business cards (d) Life time durability. (e) Spine Label for easy identification</span>', '', '', '', '', '', '', 0, 0, 1, '', '', '', '', NULL, '2018-01-06 06:08:18', '2019-08-09 11:26:14'),
(2, 1, 1, '1|2|3|112|113|114', 'BC001', 'Solo Business Card Pocket Case Pack of 2', 'solo-business-card-pocket-case-pack-of-2', '', 7, 'assets/product/BC001/BC001378685181_m.jpg', 0, '', 'F', 'RIN', 0, 0, 0, 0, '0', 0, NULL, '0', '0', '', '', 'Quality Stationery Product from Solo.', '<span open=\"\" style=\"color: rgb(119, 119, 119); font-family: \">(a) Pocket business card holder . (b) Use for yourself &amp; gift to corporate clients. (c) Holds 20- 40 cards . (d) Stands up on desk like an elegant chair for your business cards .</span>', '', '', '', '', '', '', 0, 0, 1, '', '', '', '', NULL, '2018-01-06 06:13:00', '2018-01-06 08:03:20'),
(3, 1, 1, '1|2|4|112|113|114', 'SY-081_1', 'Special L-Folder - Pack of 6 Pcs', 'special-l-folder-pack-of-6-pcs', '', 7, 'assets/product/SY-081_1/SY-081_1.jpg', 0, '', 'F', 'RIN', 0, 0, 0, 0, '0', 0, NULL, '0', '0', '', '', 'With Special Side Cut to easy access to contents.\r\nWith a stress relieving notch.\r\nUltrasonic welding at the bottom to ensure durable and non-tearing edges.', '<span open=\"\" style=\"color: rgb(119, 119, 119); font-family: \">With Special Side Cut to easy access to contents. With a stress relieving notch. Ultrasonic welding at the bottom to ensure durable and non-tearing edges.</span>', '', '', '', '', '', '', 0, 0, 1, '', '', '', '', NULL, '2018-01-06 06:24:49', '2018-01-06 08:03:39'),
(4, 1, 1, '1|2|5|112|113|114', 'SY-101F_1', 'Spring Clip File A4 Spring Clip', 'spring-clip-file-a4-spring-clip', '', 7, 'assets/product/SY-101F_1/SY-101F_1.jpg', 0, '', 'F', 'RIN', 0, 0, 0, 0, '0', 0, NULL, '0', '0', '', '', 'High quality, strong and rigid embossed polypropylene sheets for binding punched and non-punched documents.\r\nHigh quality Clip files in different varieties for varied requirements and uses.\r\nMetal punch less Clips ensures that papers are safe from slipping and are secured properly.\r\nSpring mechanism in the files allow easy and quick insertion and removal of papers.', '<span open=\"\" style=\"color: rgb(119, 119, 119); font-family: \">High quality, strong and rigid embossed polypropylene sheets for binding punched and non-punched documents. High quality Clip files in different varieties for varied requirements and uses. Metal punch less Clips ensures that papers are safe from slipping and are secured properly. Spring mechanism in the files allow easy and quick insertion and removal of papers.</span>', '', '', '', '', '', '', 0, 0, 1, '', '', '', '', NULL, '2018-01-06 06:50:12', '2018-01-06 08:03:55'),
(5, 1, 1, '1|22|23|112|113|114', 'HL-820LV', 'Casio HL-820LV', 'casio-hl-820lv', '', 7, 'assets/product/HL-820LV/HL-820LV.jpg', 0, '', 'F', 'RIN', 0, 0, 0, 0, '0', 0, NULL, '0', '0', '', '', '8 Digits Calculator with Large Display', '', '', '', '', '', '', '', 0, 0, 1, '', '', '', '', NULL, '2018-01-06 06:53:15', '2018-01-06 08:04:21'),
(6, 1, 1, '1|24|25|112|113|114', 'WP3340_2', 'Writing Pad-128x215mm-40 Sheets-Beautiful Black Cover Design - Pack of 6 Pcs', 'writing-pad-128x215mm-40-sheets-beautiful-black-cover-design-pack-of-6-pcs', '', 7, 'assets/product/WP3340_2/WP3340_2.jpg', 0, '', 'F', 'RIN', 0, 0, 0, 0, '0', 0, NULL, '0', '0', '', '', 'Premiun Quality Writing Pads\r\n- Made of finest Quality Material \r\n- Superior & Smoother Paper \r\n- Excellent finish \r\n- Available in Ruled & Plain Variants \r\n- Strong grip & micro perforated', '', '', '', '', '', '', '', 0, 0, 1, '', '', '', '', NULL, '2018-01-06 06:56:54', '2018-01-06 08:04:38'),
(7, 1, 1, '1|42|43', 'LF-4G_2', 'High Quality Lamination Rolls, Size-4', 'high-quality-lamination-rolls-size-4-104mm', '', 7, 'assets/product/LF-4G_2/LF-4G_2.jpg', 0, '', 'F', 'RIN', 0, 0, 0, 0, '0', 0, NULL, '0', '0', '', '', 'Lamination Film for use with all heat seal lamination machine\r\n\r\n- High quality lamination film \r\n- Protects your documents for years\r\n- Made of first grade material\r\n- Compatible to all heat seal laminators \r\n- Neat & Professional \r\n- Easy to use \r\n- Guaranteed lenght & result \r\n- Available in various thickness & sizes', '<span style=\"color: rgb(119, 119, 119); font-family: &quot;Open Sans&quot;, Arial, Helvetica, sans-serif;\">Lamination Film for use with all heat seal lamination machine - High quality lamination film - Protects your documents for years - Made of first grade material - Compatible to all heat seal laminators - Neat &amp; Professional - Easy to use - Guaranteed lenght &amp; result - Available in various thickness &amp; sizes</span>', '', '', '', '', '', '', 0, 0, 1, '', '', '', '', NULL, '2018-01-06 06:59:58', '2018-01-06 07:00:33'),
(8, 1, 1, '48|49|112|113|114', 'fevicol5_1', 'Fevicol Mr Squeeze Bottle 50 grams (Pack of 5)', 'fevicol-mr-squeeze-bottle-50-grams-pack-of-5-', '', 7, 'assets/product/fevicol5_1/fevicol5_1.jpg', 0, '', 'F', 'RIN', 0, 0, 0, 0, '0', 0, NULL, '0', '0', '', '', 'Easy to carry and last really long', '<span open=\"\" style=\"color: rgb(119, 119, 119); font-family: \">Most commonly used adhesive for sticking paper, cardboard, fabric etc. Non toxic Easy to carry and last really long Strong bonding Ready to use and non-staining</span>', '', '', '', '', '', '', 0, 0, 1, '', '', '', '', NULL, '2018-01-06 07:07:51', '2018-01-06 08:05:10'),
(9, 1, 1, '115|48', '12', 'vp', 'vp', '', 7, 'assets/product/12/extensive-experience-image_(1).png', 0, '', 'F', 'RIN', 0, 0, 0, 0, '0', 0, NULL, '0', '0', '', '', '', '', '', '', '', '', '', '', 0, 0, 1, '', '', '', '', NULL, '2020-06-01 09:36:00', '2020-06-01 09:36:55'),
